import React, { useState, ChangeEvent } from 'react';

interface FormData {
  formID: string;
  organizationName: string;
  navigatorName: string;
  intakeDate: string;
  personalInfo: {
    firstName: string;
    middleName: string;
    lastName: string;
    dateOfBirth: string;
    gender: string;
    countryOfOrigin: string;
    preferredLanguage: string;
    phoneNumber: string;
    email: string;
    streetAddress: string;
    city: string;
    zipCode: string;
    state: string;
    county: string;
    mailingAddress: string;
    dshsClientId: string;
    alienNumber: string;
  };
  immigrationStatus: {
    refugee: boolean;
    asylum: boolean;
    cubanHaitian: boolean;
    amerasian: boolean;
    humanTrafficking: boolean;
    iraqiAfghan: boolean;
    afghanParolee: boolean;
    ukrainianParolee: boolean;
    eligibilityDate: string;
  };
}

const CommunityOutreachForm: React.FC = () => {
  const [formData, setFormData] = useState<FormData>({
    formID: '250257640384053',
    organizationName: '',
    navigatorName: '',
    intakeDate: '',
    personalInfo: {
      firstName: '',
      middleName: '',
      lastName: '',
      dateOfBirth: '',
      gender: '',
      countryOfOrigin: '',
      preferredLanguage: '',
      phoneNumber: '',
      email: '',
      streetAddress: '',
      city: '',
      zipCode: '',
      state: '',
      county: '',
      mailingAddress: '',
      dshsClientId: '',
      alienNumber: ''
    },
    immigrationStatus: {
      refugee: false,
      asylum: false,
      cubanHaitian: false,
      amerasian: false,
      humanTrafficking: false,
      iraqiAfghan: false,
      afghanParolee: false,
      ukrainianParolee: false,
      eligibilityDate: ''
    }
  });

  const handleChange = (e: ChangeEvent<HTMLInputElement>) => {
    const { name, value, type, checked } = e.target;

    if (name.includes('.')) {
      const [section, field] = name.split('.');
      setFormData(prev => {
        if (section in prev) {
          const sectionObj = prev[section as keyof FormData];
          if (typeof sectionObj === 'object' && sectionObj !== null) {
            return {
              ...prev,
              [section]: {
                ...sectionObj,
                [field]: type === 'checkbox' ? checked : value
              }
            };
          }
        }
        return prev;
      });
    } else {
      setFormData(prev => ({
        ...prev,
        [name]: type === 'checkbox' ? checked : value
      }));
    }
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log(formData);
  };

  return (
    <div style={{ maxWidth: '1000px', margin: '0 auto', padding: '20px' }}>
      <h1 style={{ textAlign: 'center', marginBottom: '20px' }}>
        Community Outreach and Education Intake/Registration Form
      </h1>

      <form onSubmit={handleSubmit}>
        <div style={{ marginBottom: '20px' }}>
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3, 1fr)', gap: '10px' }}>
            <div>
              <label>Organization Name</label>
              <input
                type="text"
                name="organizationName"
                value={formData.organizationName}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Navigator Name</label>
              <input
                type="text"
                name="navigatorName"
                value={formData.navigatorName}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
            <div>
              <label>Intake Date</label>
              <input
                type="date"
                name="intakeDate"
                value={formData.intakeDate}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
          </div>
        </div>

        <div style={{ marginBottom: '20px', border: '1px solid #ccc', padding: '15px' }}>
          <h2>Participant Information</h2>
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3, 1fr)', gap: '10px' }}>
            {[
              { label: 'First Name', field: 'firstName' },
              { label: 'Middle Name', field: 'middleName' },
              { label: 'Last Name', field: 'lastName' },
              { label: 'Date of Birth', field: 'dateOfBirth', type: 'date' },
              { label: 'Gender', field: 'gender' },
              { label: 'Country of Origin', field: 'countryOfOrigin' },
              { label: 'Preferred Language', field: 'preferredLanguage' },
              { label: 'Phone Number', field: 'phoneNumber', type: 'tel' },
              { label: 'Email', field: 'email', type: 'email' },
              { label: 'Street Address', field: 'streetAddress', span: 2 },
              { label: 'City', field: 'city' },
              { label: 'State', field: 'state' },
              { label: 'Zip Code', field: 'zipCode' },
              { label: 'County', field: 'county' },
              { label: 'DSHS Client ID #', field: 'dshsClientId' },
              { label: 'Alien #', field: 'alienNumber' }
            ].map(({ label, field, type = 'text', span }) => (
              <div 
                key={field}
                style={span ? { gridColumn: `span ${span}` } : {}}
              >
                <label>{label}</label>
                <input
                  type={type}
                  name={`personalInfo.${field}`}
                  value={formData.personalInfo[field as keyof typeof formData.personalInfo]}
                  onChange={handleChange}
                  style={{ width: '100%', padding: '8px', marginTop: '5px' }}
                />
              </div>
            ))}
          </div>
        </div>

        <div style={{ marginBottom: '20px', border: '1px solid #ccc', padding: '15px' }}>
          <h2>Current Immigration Status</h2>
          <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
            {[
              ['refugee', 'Refugee'],
              ['asylum', 'Asylum'],
              ['cubanHaitian', 'Cuban and Haitian entrants'],
              ['amerasian', 'Amerasians'],
              ['humanTrafficking', 'Certified victims of human trafficking'],
              ['iraqiAfghan', 'Iraqi and Afghan Special Immigrants'],
              ['afghanParolee', 'Afghan Humanitarian Parolees'],
              ['ukrainianParolee', 'Ukrainian Humanitarian Parolees']
            ].map(([key, label]) => (
              <label key={key} style={{ display: 'flex', alignItems: 'center' }}>
                <input
                  type="checkbox"
                  name={`immigrationStatus.${key}`}
                  checked={formData.immigrationStatus[key as keyof typeof formData.immigrationStatus] as boolean}
                  onChange={handleChange}
                  style={{ marginRight: '8px' }}
                />
                {label}
              </label>
            ))}
            <div style={{ marginTop: '10px' }}>
              <label>Eligibility Date</label>
              <input
                type="date"
                name="immigrationStatus.eligibilityDate"
                value={formData.immigrationStatus.eligibilityDate}
                onChange={handleChange}
                style={{ width: '100%', padding: '8px', marginTop: '5px' }}
              />
            </div>
          </div>
        </div>

        <div style={{ display: 'flex', justifyContent: 'flex-end', marginTop: '20px' }}>
          <button
            type="submit"
            style={{
              backgroundColor: '#4299e1',
              color: 'white',
              padding: '10px 20px',
              borderRadius: '4px',
              border: 'none',
              cursor: 'pointer'
            }}
          >
            Submit
          </button>
        </div>
      </form>
    </div>
  );
};

export default CommunityOutreachForm;
